//#region react
import React from 'react';
//#endregion

//#region mui
import Grid from '@mui/material/Grid';
import Radio from '@mui/material/Radio';
import FormControlLabel from '@mui/material/FormControlLabel';
//#endregion

function TokenRadioButton(props) {
    const { values } = props;

    function test()
    {
        console.log("Gd")
    }
    function RadioButton(value) {
        return (
            <Grid item key={value._id}>
                <FormControlLabel value={value.tokenId} control={<Radio onClick={test} />} label={"TokenId: " + value.tokenId} />
            </Grid>
        )
    }
    //#region 렌더링
    return (
        <Grid>
            {values.map((value) => (
                RadioButton(value)
            ))}
        </Grid>)
    //#endregion
}

export default TokenRadioButton;
